import React from 'react';
import CardComponent from './components/Card';
import Layout from './components/Layout';
import Toggle from './components/Toggle';
export default class App extends React.Component {
	render() {
		return (
			<>
				<Layout>
					<CardComponent />
					<Toggle />
				</Layout>
			</>
		);
	}
}
